import React, { createContext } from "react";
import ComA from "./ComA";


let FirstName = createContext();
let LastName = createContext();

const App = () => {
    return (
        <>
            <FirstName.Provider value={"Hayee Dard"}>
                <LastName.Provider value={"Bhout Hai Yaar"}>
                    <ComA />
                </LastName.Provider>
            </FirstName.Provider>
        </>
    )
}

export default App;
export { FirstName, LastName };
